import React, { Component } from 'react';
import './Vasilis.css';
import profilePicture from './me-drawing.png';

class Vasilis extends Component {
  render() {
    scrollFunction = () => {
      console.log('done');
    }

    return (
      <div className="vasilis" onwheel={scrollFunction}>
        <img src={profilePicture} className="main__picture"></img>
      </div>
    );
  }
}

export default Vasilis;
